import {useRouter} from 'next/router'

import {MainLayout} from '../../layouts/MainLayout'

export default function Post() {
    const router = useRouter()
    // console.log('router: ', router);
    return (
       <MainLayout>
         <h1>
            Post router.query.template = {router.query.template}
         </h1>
       </MainLayout>
    )
}
